import Socials from "./Socials";

function App() {
  return (
    <div className="">
      <div>
        <Socials/>
      </div>
      <div className="o">
        <Home />
        <About />
        <Skills/>
        <Projects />
        <Contact />
      </div>



    </div>
  );
}

export default App;
